export const StockData={
    '1':{
        name:'papers',
        quantity:2000,
    },
    '2':{
        name:'computers',
        quantity:12,
    }
}

export const getData = (code) => StockData[code];
export const getAllStock = () => StockData;
export const codes = Object.keys(StockData);
